const tolerance = 5
const dexReducer = (currentMap, currentPokemon, listAttribute) => {
	const currentPokemonInfo = currentPokemon.get('info')
	currentPokemon.get(listAttribute).map((elem) => {
		const rate = elem.get('rate')
		if (rate > tolerance) {
			currentMap = currentMap.update(elem.get('name'), Immutable.List(), pokemonList => pokemonList.push(currentPokemonInfo.set('rate', rate)))
		}
	})
	return currentMap
}

const itemdex = pokedex.reduce((currentMap, currentPokemon) => dexReducer(currentMap, currentPokemon, 'items'), Immutable.Map())
const movedex = pokedex.reduce((currentMap, currentPokemon) => dexReducer(currentMap, currentPokemon, 'moves'), Immutable.Map())
const abilitydex = pokedex.reduce((currentMap, currentPokemon) => dexReducer(currentMap, currentPokemon, 'abilities'), Immutable.Map())

const nameReducer = (currentArray, currentValue, key) => {
	currentArray.push({
		label: key,
		value: key
	})
	return currentArray
}

const itemNames = itemdex.reduce(nameReducer, [])
const moveNames = movedex.reduce(nameReducer, [])
const abilityNames = abilitydex.reduce(nameReducer, [])
const pokemonNames = pokedex.reduce((currentArray, currentValue, key) => {
    currentArray.push({
      	label: currentValue.getIn(['info', 'fname']),
      	value: key
    })
    return currentArray
 }, []);

const dex = Immutable.Map().set('Pokemon', pokedex).set('Items', itemdex).set('Moves', movedex).set('Abilities', abilitydex)
const options = Immutable.Map().set('Pokemon', pokemonNames).set('Items', itemNames).set('Moves', moveNames).set('Abilities', abilityNames)
const date = 'February 28, 2016'
export {
	dex,
	options,
	date
}
